  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment is for the
  implemetation of a fishing program on Marais Des Cygnes National Wildlife Refuge.
  \ The Findning of No Significant Impact (FONSI) is in this EA as well. The proposed
  action is to implement a fishing program on Marais des Cygnes National Wildlife
  Refuge (MDC Refuge) to manage fish populations at optimum levels and to provide
  recreational opportunities. The proposed fishing program will be in accordance with
  the current fishing plan. Implementation of the proposed action will be consistent
  and compatible with the Refuge Recreation Act, Refuge Administration Act, the Environmental
  Assessment for the Proposed Establishment of Marais des Cygnes NWR ( EA), and the
  Marais des Cygnes NWR Comprehensive Management Plan (CMP).\",\n\t\"license_title\":
